import "./App.css";
import axios from "axios";
import { useEffect, useState } from "react";

function App() {


  return (
    <div className="App">
      {listOfUsers.map((value, key) => {
        return (
          <div className="users">
            <p>Name: {value.username}</p>
            <p>pass: {value.password}</p>
            <p>email: {value.email}</p>
            <p>score: {value.score}</p>
          </div>
        );
      })}
    </div>
  );
}

export default App;
